import react from "react";

const PrimaComponent = () => 
{
    return(
        <div>
            <h1>Lista film</h1>
            <div className="col-md-12" style={{marginTop:"5%", padding:"5px"}}>
                <div className="row">
                    <div className="col">
                        <SecondaComponent/>
                    </div>
                    <div className="col">
                        <SecondaComponent/>
                    </div>
                    <div className="col">
                        <SecondaComponent/>
                    </div>
                    <div className="col">
                        <SecondaComponent/>
                    </div>
                </div>
            </div>
        </div>
    );
}

const SecondaComponent = () =>
{
    const titolo = 
    <>
        <h1>Profili</h1>
        <h3>Persona</h3>
    </>;

    let nome = "Luca";
    let cognome = "Verdi";
    let eta = 20;
    let id = "x23A";

    return(
        <>
            {titolo}
            <div style={{padding:"20px",border:"1px solid black", display:"inline-block"}}>
                <h6>{nome} {cognome}</h6>
                <p>Et√† : {eta}</p>
                <button className="view-button" onClick={() => alert("Vuoi andare alla pagina "+id) }>Go To Profile</button>
            </div>
        </>
    );
}

export default PrimaComponent;
